}

.plan__discount,
.badge,
.badge--secondary {
  background: #03d2ee;
}

.plan__description {
  display: block;
  font-weight: 400;
  letter-spacing: 1.5;
  margin-top: 5px;
}

.plan .list__item {
  margin-bottom: 2.5rem;
  letter-spacing: 2;
}

.plan--popular .card__header {
  position: relative;
}

.plan--popular .card__header::before {
  content: url(../images/popular.svg);
  width: 40px;
  display: inline-block;
  position: absolute;
  top: -3px;
  right: 5%;
}

@media screen and (min-width: 1024px) {
  .plan__name {
    font-size: 1.4rem;
  }

  .plan__price {
    font-size: 5rem;
  }

  .plan__duration {
    font-size: 1.6rem;
  }

  .plan__description {
    font-size: 1.7rem;
  }

  .plan--popular {
    transform: scale(1.1);
  }
}

/* MEDIA  */
.media {
  display: flex;
  margin-bottom: 3rem;
}

.media__image {
  margin-top: 1.3rem;
}

.media__body {
  margin: 0 2rem;
}

.media__title {
  margin: 0 0 1.5rem 0;
}

/* QUOTE */
.quote {
  font-size: 3rem;
  font-style: italic;
  color: var(--color-body-darker);
}

.quote__text::before {
  content: open-quote;
}

.quote__text::after {
  content: close-quote;
}

.quote__author {
  font-style: normal;
  margin-bottom: 0;
}

.company__name {
  font-style: normal;
  color: var(--color-heading);
  font-size: 2rem;
  opacity: 0.4;
}

.quote__line {
  position: relative;
  bottom: 8px;
}

@media screen and (min-width: 1024px) {
  .quote__author {
    font-size: 2.4rem;
  }

  .company__name {
    font-size: 1.6rem;
  }
}

/* GRID */
.grid {
  display: grid;
}

@media screen and (min-width: 768px) {
  .grid--1x2 {
    grid-template-columns: repeat(2, 1fr);
  }
}

@media screen and (min-width: 1024px) {
  .grid--1x3 {
    grid-template-columns: repeat(3, 1fr);
  }
}

/* TESTIMONIAL */
.testimonial {
  padding: 3rem;
}

.testimonial__image-container {
  position: relative;
}

.testimonial__image-container > .testimonial__image {
  width: 100%;
}

.testimonial__image-container > .testimonial-icon {
  position: absolute;
  right: -32px;
  top: 3rem;
}

@media screen and (min-width: 768px) {
  .testimonial-info .quote__text {
    font-size: 2rem;
  }

  .testimonial-media .media__title {
    font-size: 2rem;
  }

  .testimonial-media .company__name {
    font-size: 1.5rem;
  }
}

/* CALLOUT */
.callout {
  padding: 2rem 4rem;
  border-radius: 5px;
  text-align: center;
}

.callout--primary {
  background: var(--color-primary);
  color: #fff;
}

.callout__info .callout__heading {
  margin-top: 0;
  color: #fff;
}

@media screen and (min-width: 768px) {
  .callout {
    text-align: left;
  }

  .callout .grid--1x2 {
    grid-template-columns: 1fr auto;
  }

  .callout__btn .btn--block {
    width: auto;
    margin-left: 3rem;
  }
}

/* COLLAPSIBLE */
.collapsible {
  /* margin-bottom: 1rem; */
}
.collapsible__header {
  display: flex;
  justify-content: space-between;
  cursor: pointer;
}

.collapsible__heading {
  margin-top: 0;
}

.collapsible__chevron {
  transform: rotate(-90deg);
  transition: transform 0.3s;
}

.collapsible__content {
  max-height: 0;
  overflow: hidden;
  opacity: 0;
  transition: all ease-in-out 0.3s;
}

.collapsible--expanded .collapsible__chevron {
  transform: rotate(0);
}

.collapsible--expanded .collapsible__content {
  max-height: 100vh;
  opacity: 1;
}

/* BLOCKS */
.block {
  --padding-vertical: 4rem;
  padding: var(--padding-vertical) 2rem;
}

.block__header {
  text-align: center;
  margin-bottom: 4rem;
}

.block__heading {
  margin-top: 0;
}

.block--dark {
  background: #000;
  color: #7b858b;
}

.block--dark h1,
.block--dark h2,
.block--dark h3 {
  color: #fff;
}

.block--skewed-left {
  padding-bottom: calc(var(--padding-vertical) + 4rem);
  clip-path: polygon(0% 0%, 100% 0%, 100% 100%, 0% 90%);
}

.block--skewed-right {
  padding-bottom: calc(var(--padding-vertical) + 4rem);
  clip-path: polygon(0% 0%, 100% 0%, 100% 90%, 0% 100%);
}

/* NAVIGATION */
.navigation {
  background: #000;
  display: flex;
  justify-content: space-between;
  flex-wrap: wrap;
  align-items: center;
}

.nav__brand {
  transform: translateY(5px);
}

.nav__toggler {
  opacity: 0.5;
  cursor: pointer;
  margin: 0 1rem;
  transition: box-shadow 0.15s;
}

.nav__list {
  width: 100%;
  margin: 0;
}

.nav__item {
  padding: 0.7rem 2rem;
  border-bottom: 1px solid #222;
}

.nav__item > a {
  color: #d2d0db;
  transition: color 0.3s;
}

.nav__item > a:hover {
  color: #fff;
}

.navigation.collapsible--expanded .nav__toggler {
  opacity: 1;
  box-shadow: 0 0 0 3px #666;
  border-radius: 5px;
}

@media screen and (min-width: 768px) {
  .nav__toggler {
    display: none;
  }

  .nav__list {
    width: auto;
    display: flex;
    font-size: 1.6rem;
    max-height: 100%;
    opacity: 1;
  }

  .nav__item {
    border: 0;
  }
}

/* HERO CONTENT */

.hero__tagline {
  font-size: 2rem;
  color: #b9c3cf;
  letter-spacing: 1px;
  margin: 2rem 0 5rem;
}

.hero__image {
  width: 100%;
  margin-left: 5rem;
}

@media screen and (min-width: 768px) {
  .hero {
    padding-top: 0;
  }

  .hero__content {
    text-align: left;
    align-self: center;
  }
}

/* DOMAIN BLOCK */
.block-domain .input-group {
  border: 0;
  box-shadow: 0 0 50px 20px #e6ebee;
  margin: 4rem auto;
}

.block-domain__price {
  color: var(--color-heading);
  display: grid;
  grid-template-columns: repeat(2, 1fr);
  grid-template-rows: repeat(2, 6rem);
  font-size: 2rem;
  font-weight: 700;
  margin: 5rem 0 0 0;
  text-align: center;
  max-width: 800px;
  margin: 0 auto;
}

@media screen and (min-width: 768px) {
  .block-domain__price {
    grid-template-columns: repeat(auto-fit, minmax(100px, 1fr));
  }
}

/* PLAN BLOCK */
.block-plans .grid {
  gap: 4rem;
}

.block-plans .card {
  max-width: 500px;
  margin: 0 auto;
  transition: transform 0.3s ease-in-out;
}

.block-plans .card:hover {
  transform: scale(1.05);
}

/* feature */
.feature {
  gap: 4rem 2rem;
  margin: 8rem 0;
}

.feature:first-of-type {
  margin: 4rem;
}

.feature__image {
  width: 100%;
}

@media screen and (min-width: 768px) {
  .feature:nth-of-type(even) .feature__content {
    order: 2;
  }
}

/* SHOWCASE */
.block-showcase__image > img {
  width: 100%;
}

@media screen and (min-width: 768px) {
  .block-showcase .grid {
    grid-template-columns: 50% 50%;
  }

  .block-showcase__image {
    justify-self: end;
  }

  .block-showcase__image > img {
    width: auto;
    max-width: 700px;
  }
}

/* FOOTER */
.footer {
  background: #232323;
}

.footer a {
  color: #777;
  transition: color 0.3s;
}

.footer a:hover {
  color: #fff;
}

.footer__heading {
  font-size: 3rem;
}

.footer .list {
  margin: 0;
}

.footer__section {
  padding: 2rem;
  border-bottom: 1px solid #393939;
}

.footer__brand {
  margin-top: 4rem;
  text-align: center;
}

.footer__copyright {
  font-size: 2.1rem;
  color: #fff;
  opacity: 0.3;
}

@media screen and (min-width: 768px) {
  .footer__sections {
    grid-template-columns: repeat(auto-fit, minmax(10rem, 1fr));
  }

  .footer .collapsible__chevron {
    display: none;
  }

  .footer .collapsible__content {
    opacity: 1;
    max-height: 100%;
  }

  .footer__brand {
    order: -1;
    margin-top: 1rem;
  }

  .footer__brand > img {
    width: 100%;
  }

  .footer__section {
    border: 0;
  }

  .footer__heading {
    font-size: 1.6rem;
  }

  .footer__copyright {
    font-size: 1.5rem;
  }
}
